== 3rd Wing == * This article should be called and referencing the "3rd" Wing and not the "3d" Wing. Even on the Elmendorf homepage it's listed as the 3rd Wing. - [[User:Gunnanmon|Gunnanmon]] ([[User talk:Gunnanmon|talk]]) 21:17, 21 May 2010 (UTC)
== Merger proposal == * I propose that [[3d Wing]] be merged into [[3rd Wing]]. The original "3rd Wing" article was improperly redirected into "3d Wing", which is a recreation of "3rd Wing" but with an incorrect title. The edit history supports this. A merger should be undertaken so as to not lose the edit history of "3d Wing", which has been worked on as the original was no longer available. [[User:Ng.j|Ng.j]] ([[User talk:Ng.j|talk]]) 20:04, 12 April 2011 (UTC) * I have history-merged [[3d Wing]] to [[3rd Wing]]. [[3rd Wing]] was cut-and-paste moved to [[3d Wing]] at about 11:16, 14 July 2008. The edits that were made after [[3rd Wing]] was reverted to text at 19:58, 12 April 2011, are now in [[3rd Wing/version 2]]. [[User:Anthony Appleyard|Anthony Appleyard]] ([[User talk:Anthony Appleyard|talk]]) 22:26, 18 April 2011 (UTC)
